import React from 'react'
import './dashBnav.css'

function DashBnav() {
  return (
    <div className='top'>
      
      <div className='item'><button className='btn2'>ADD</button></div>
     
      <div className='item'><button className='btn3'>LOGOUT</button></div>
      
    </div>
  )
}

export default DashBnav
